public SimpleOrderedMap<Object> readOrderedMap(DataInputInputStream dis) throws IOException {
  int sz = readSize(dis);
  SimpleOrderedMap<Object> nl = new SimpleOrderedMap<Object>();
  for (int i = 0; i < sz; i++) {
    String name = (String) readVal(dis);
    Object val = readVal(dis);
    nl.add(name, val);
  }
  return nl;
}

